using System;using System.Collections.Generic;using System.Text.Json.Serialization;namespace MicroFeel.Yonyou.Api{	public class Currency	{		///<Summary>		///币种名称		///</Summary>		[JsonPropertyName("cexch_name")]		public string CexchName { get;set; }		///<Summary>		///币种编码		///</Summary>		[JsonPropertyName("cexch_code")]		public string CexchCode { get;set; }		///<Summary>		///是否本位币(-1:是 0：否)		///</Summary>		[JsonPropertyName("iotherused")]		public float Iotherused { get;set; }		///<Summary>		///折算方式		///</Summary>		[JsonPropertyName("bcal")]		public string Bcal { get;set; }		///<Summary>		///小数位数		///</Summary>		[JsonPropertyName("idec")]		public float Idec { get;set; }		///<Summary>		///最大误差		///</Summary>		[JsonPropertyName("nerror")]		public float Nerror { get;set; }		///<Summary>		///时间戳		///</Summary>		[JsonPropertyName("timestamp")]		public float Timestamp { get;set; }	}}